import { lazy, Suspense } from "react";
import { Navigate, Route, Routes } from "react-router-dom";
import routesFront from "../../shared/routes/routesFrontend.routes";
const IndexHtml = lazy(() =>
  import("../components/IndexHtml.component").then((m) => ({
    default: m.IndexHtml,
  }))
);
export const RouterLogin = (data: any) => {
  if (data.users)
    return <Navigate to={routesFront.module + routesFront.main} />;
  return (
    <Routes>
      <Route
        index
        element={
          <Suspense fallback={<div>Loading...</div>}>
            <IndexHtml />
          </Suspense>
        }
      ></Route>
    </Routes>
  );
};
